from typing import List, Tuple

def solve(n: int, q: int, painters: List[Tuple[int, int]]) -> int:
    def painted_sections(left: int, right: int) -> List[bool]:
        sections = [False] * (n + 1)
        for i, j in painters:
            if i <= right and j >= left:
                for k in range(max(i, left), min(j, right) + 1):
                    sections[k] = True
        return sections

    max_painted = 0
    for i in range(q):
        for j in range(i + 1, q):
            total_painted = sum(painted_sections(1, n))
            sections_i = painted_sections(painters[i][0], painters[i][1])
            sections_j = painted_sections(painters[j][0], painters[j][1])
            common_sections = [sections_i[k] or sections_j[k] for k in range(1, n + 1)]
            max_painted = max(max_painted, total_painted - sum(common_sections))

    return max_painted

solve()

