def solve():
    n, q = map(int, input().split())
    painters = [list(map(int, input().split())) for _ in range(q)]

    sections = [0] * (n + 1)
    for l, r in painters:
        sections[l - 1] += 1
        sections[r] -= 1

    prefix_sum = [0] * (n + 1)
    for i in range(1, n + 1):
        prefix_sum[i] = prefix_sum[i - 1] + sections[i]

    painted = [0] * (n + 1)
    for i in range(1, n + 1):
        if prefix_sum[i] >= q - 2:
            painted[i] = 1

    max_painted = 0
