from heapq import *

def solve(n, k, p):
    remaining = list(range(n, k, -1))
    stack = []
    output = []

    for i in range(k):
        output.append(p[i])
        if not stack or stack[0] > p[i]:
            heappush(stack, p[i])
        else:
            return -1

    for i in range(k, n):
        if stack:
            top = heappop(stack)
            if top > remaining[-1]:
                return -1
            output.append(top)
        else:
            output.append(remaining.pop())

    return output

solve()

