from typing import List

def solve(n: int, k: int) -> List[List[int]:
    if k > n*n:
        return [[-1]]

    matrix = [[0 for _ in range(n)] for _ in range(n)]

    for i in range(n):
        for j in range(n):
            if k == 0:
                break
            if i == j:
                matrix[i][j] = 1
                k -= 1
            elif i < j:
                sym_value = min(k, 2)
                matrix[i][j] = sym_value
                matrix[j][i] = sym_value
                k -= sym_value

    return matrix

