def solve():
    from math import sqrt, floor, ceil

    def find_layer(n):
        k = ceil((sqrt(12*n + 9) - 3) / 6)
        return k

    def get_coordinates(n, layer):
        side_length = 2 * layer
        corners = [3 * layer * (layer - 1) + 1 + i * 6 * layer for i in range(6)]

        for i in range(6):
            if corners[i] <= n <= corners[(i+1) % 6]:
                if i == 0:
                    x = -layer + n - corners[i]
                    y = layer
                elif i == 1:
                    x = -layer
                    y = layer - n + corners[i]
                elif i == 2:
                    x = -layer - (corners[(i+1) % 6] - n)
                    y = -layer
                elif i == 3:
                    x = layer
                    y = -layer + (corners[i] - n)
                elif i == 4:
                    x = layer - (corners[(i+1) % 6] - n)
                    y = -layer
                elif i == 5:
                    x = layer
                    y = -layer + n - corners[i]
                return x, y

    n = int(input())
    layer = find_layer(n)
    x, y = get_coordinates(n, layer)
    print(x, y)

solve()

