def solve(n: int, k: int) -> str:
    if n < 2**(k-1):
        return "No"

    result = [0] * k
    for i in range(k-1, -1, -1):
        power = 2**i
        result[i] = min(n - (2**i), 2**i)
        n = max(n - power, power)

    if n == 0:
        return "Yes\n" + " ".join(map(str, result))
    else:
        return "No"

