    if n % 2 == 1:
        print("No")
        return

    ans = []
    while n > 0:
        p = n.bit_length() - 1
        if n - 2 ** p + 1 <= k:
            ans.extend([p] * (n - 2 ** p + 1))
            k -= n - 2 ** p + 1
            n = 2 ** p - 1
        else:
            ans.extend([p] * k)
            n = 0

