def solve():
    # Importing required libraries
    from math import gcd

    # Function to calculate the number of prefixes with balance equal to x
    def prefixes_with_balance(n, x, s):
        cnt0, cnt1 = s.count('0'), s.count('1')
        total_balance = cnt0 - cnt1

        if total_balance == 0:
            if x == 0:
                for i in range(1, n + 1):
                    if cnt0 * i == cnt1 * n:
                        return i
                return -1
            else:
                return 0
        else:
            d = gcd(cnt0, cnt1)
            step = cnt0 // d
            for i in range(0, 10005, step):
                if (x - total_balance * i) % d == 0:
                    if 0 <= (x - total_balance * i) // d <= n:
                        return 1
            return -1

