    dp = [[[0] * 3 for _1 in range(T + 1)] for _2 in range(math.factorial(n))]
    for i in range(n):
        dp[math.factorial(i)][0][0] = 1

    for i in range(math.factorial(n)):
        for j in range(T):
            for k in range(n):
                ti, gi = songs[k]
                if j + ti <= T:
                    for g in range(3):
                        if dp[i][j][g] > 0:
