def solve():
    N = int(input())
    board = [list(map(int, input().split())) for _ in range(N)]

    def get_position(num):
        for i in range(N):
            for j in range(N):
                if board[i][j] == num:
                    return (i, j)

    def manhattan_dist(pos1, pos2):
        return abs(pos1[0] - pos2[0]) + abs(pos1[1] - pos2[1])

    def knight_dist(pos1, pos2):
        return max(abs(pos1[0] - pos2[0]), abs(pos1[1] - pos2[1]))

    def combos():
        moves = ['knight', 'bishop', 'rook']
        for perm in permutations(moves):
            for move in perm:
                yield move

    best_steps = float('inf')
    best_replacements = float('inf')

    for perm in combos():
        steps = 0
        replacements = 0
        curr_pos = (0, 0)
        for num in range(1, N * N + 1):
            new_pos = get_position(num)
            if perm[0] == 'knight':
                steps += knight_dist(curr_pos, new_pos)
            elif perm[0] == 'bishop':
                steps += manhattan_dist(curr_pos, new_pos)
            elif perm[0] == 'rook':
                steps += max(abs(curr_pos[0] - new_pos[0]), abs(curr_pos[1] - new_pos[1]))

            if num != 1:
                if perm[0] != perm[1]:
                    replacements += 1
            curr_pos = new_pos

        if steps < best_steps or (steps == best_steps and replacements < best_replacements):
