        if (next[0] < 0 or next[0] >= N) or (next[1] < 0 or next[1] >= N):
            return False
        return True

    def knight_moves(x, y):
        queue = deque([(x, y, 0)])
        visited = [[False for _ in range(N)] for _ in range(N)]
        visited[x][y] = True
        while queue:
            curr_x, curr_y, steps = queue.popleft()
            if board[curr_x][curr_y] == N*N:
                return steps, 0
            for move in moves.values():
                next_x, next_y = curr_x + move[0], curr_y + move[1]
                if valid_move((curr_x, curr_y), (next_x, next_y)) and not visited[next_x][next_y]:
                    queue.append((next_x, next_y, steps + 1))
                    visited[next_x][next_y] = True
        return -1, -1

