import math

def solve():
    n, m, r, k = map(int, input().split())

    def num_fishes(x, y):
        return (max(1, min(x + r - 1, n) - max(x, 1) + 1) * max(1, min(y + r - 1, m) - max(y, 1) + 1))

    def calc(x, y):
        return num_fishes(x, y) * (n - r + 1) * (m - r + 1)

    def find_next(pq):
        if not pq:
            return (1, 1)
        return pq.pop()

    pq = []
    for x in range(1, r + 1):
        for y in range(1, r + 1):
            pq.append((calc(x, y), (x, y)))

    ans = 0
    for _ in range(k):
        (val, (x, y)) = find_next(pq)
        ans += val
        for dx in range(-1, 2):
            for dy in range(-1, 2):
                if 1 <= x + dx <= r and 1 <= y + dy <= r:
                    new_x, new_y = x + dx, y + dy
                    pq.append((calc(new_x, new_y), (new_x, new_y)))
    print("{:.10f}".format(ans / ((n - r + 1) * (m - r + 1)))

solve()

