from math import comb

def solve():
    def helper(r, s, p):
        total = comb(r + s + p, 2)
        dp = [[[0.0] * 102 for _ in range(102)] for _ in range(102)]
        dp[r][s][p] = 1.0

        for i in range(r, 102):
            for j in range(s, 102):
                for k in range(p, 102):
                    if i == 0 and j == 0:
                        dp[i][j][k] += dp[i][j][k-1] * (k / (k-1)) if k > 1 else 0.0
                    elif j == 0 and k == 0:
                        dp[i][j][k] += dp[i-1][j][k] * (i / (i-1)) if i > 1 else 0.0
                    elif i == 0 and k == 0:
                        dp[i][j][k] += dp[i][j-1][k] * (j / (j-1)) if j > 1 else 0.0
                    else:
                        denom = i * j + j * k + k * i

                        dp[i][j][k] += dp[i][j-1][k] * (j / denom)
                        dp[i][j][k] += dp[i][j][k-1] * (k / denom)
                        dp[i][j][k] += dp[i-1][j][k] * (i / denom)

        return dp

    r, s, p = map(int, input().split())
    dp = helper(r, s, p)
    total = comb(r + s + p, 2)

    res_r = sum(dp[i][0][0] for i in range(r)) / total
    res_s = sum(dp[0][j][0] for j in range(s)) / total
    res_p = sum(dp[0][0][k] for k in range(p)) / total

    return f"{res_r:.12f} {res_s:.12f} {res_p:.12f}"

solve()

