def solve():
    n, m = map(int, input().strip().split())
    cells = [input().strip() for _ in range(n)]

    left = top = n+m
    right = bottom = 0

    for i in range(n):
        for j in range(m):
            if cells[i][j] == 'B':
                left = min(left, j)
                right = max(right, j)
                top = min(top, i)
                bottom = max(bottom, i)

    if left == n+m:  # No black cells found
        return 1

    side = max(right - left + 1, bottom - top + 1)

    for i in range(top, bottom+1):
        for j in range(left, right+1):
            if cells[i][j] != 'B':
                return -1

    return side**2 - (right - left + 1) * (bottom - top + 1)

