from collections import defaultdict

def solve():
    n, m = map(int, input().split())
    edges = []
    for _ in range(m):
        u, v = map(int, input().split())
        edges.append((u, v))

    graph = defaultdict(list)
    for u, v in edges:
        graph[u].append(v)

    def has_cycle(node, visited, stack):
        visited[node] = True
        stack[node] = True

        for neighbor in graph[node]:
            if not visited[neighbor]:
                if has_cycle(neighbor, visited, stack):
                    return True
            elif stack[neighbor]:
                return True

        stack[node] = False
        return False

    def is_acyclic():
        visited = [False] * (n + 1)
        stack = [False] * (n + 1)

        for node in range(1, n + 1):
            if not visited[node]:
                if has_cycle(node, visited, stack):
                    return False

        for edge in edges:
            graph[edge[0]].remove(edge[1])
            visited = [False] * (n + 1)
            stack = [False] * (n + 1)

            acyclic = True
            for node in range(1, n + 1):
                if not visited[node]:
                    if has_cycle(node, visited, stack):
                        acyclic = False
                        break

            graph[edge[0]].append(edge[1])

            if acyclic:
                return "YES"

        return "NO"

    result = is_acyclic()
    print(result)

solve()

