def solve():
    n, m = map(int, input().split())
    antennas = [list(map(int, input().split())) for _ in range(n)]

    covered = [False] * (m+1)
    for x, s in antennas:
        start = max(1, x - s)
        end = min(m, x + s)
        for i in range(start, end+1):
            covered[i] = True

    coins = 0
    curr_min_uncovered = 1
    while curr_min_uncovered <= m:
        if not covered[curr_min_uncovered]:
            coins += 1
            for i in range(curr_min_uncovered, m+1):
                if covered[i]:
                    curr_min_uncovered = i + 1
                    break
        else:
            curr_min_uncovered += 1

    return coins

