def solve(n: int) -> int:
    MOD = 998244353

    def count_trees(vertices):
        if vertices == 1:
            return 1
        if vertices <= 2:
            return 0

        ans = 0
        for i in range(1, vertices):
            left_vertices = i - 1
            right_vertices = vertices - i
            ans = (ans + count_trees(left_vertices) * count_trees(right_vertices)) % MOD

        return ans

    return count_trees(n)

solve()

