from math import comb

def solve(n: int) -> int:
    MOD = 998244353

    if n % 2 == 0:
        return 0

    result = 0
    for k in range(n // 2 + 1):
        result = (result + comb(n - k, k, exact=True) * comb(2*k, k, exact=True)) % MOD

    return result % MOD

solve()

