def solve():
    MOD = 10**9 + 7
    n, x, pos = map(int, input().split())

    def power(a, b):
        if b == 0:
            return 1
        res = power(a, b // 2)
        res = (res * res) % MOD
        if b % 2 == 1:
            res = (res * a) % MOD
        return res

    def nCr(n, r):
        if r == 0 or r == n:
            return 1
        numer = denom = 1
        for i in range(n, n-r, -1):
            numer = (numer * i) % MOD
        for i in range(2, r+1):
            denom = (denom * i) % MOD
        return (numer * power(denom, MOD-2)) % MOD

    less, greater = x-1, n-x
    left, right = 0, n
    ans = 1

    while left < right:
        middle = (left + right) // 2
        if middle == pos:
            left = middle + 1
        elif middle < pos:
            ans = (ans * less) % MOD
            less -= 1
            left = middle + 1
        else:
            ans = (ans * greater) % MOD
            greater -= 1
            right = middle

    ans = (ans * nCr(less+greater, n-pos-1)) % MOD
    print(ans)

solve()

