    MOD = 10**9 + 7

    def mod_inv(x):
        return pow(x, MOD - 2, MOD)

    n, k = map(int, input().split())
    a = list(map(int, input().split()))

    fact = [1]
    for i in range(1, 101):
        fact.append((fact[-1] * i) % MOD)

    inv_fact = [mod_inv(fact[i]) for i in range(101)]

    def nCr(n, r):
        return (fact[n] * inv_fact[r] * inv_fact[n - r]) % MOD

    total_pairs = n * (n - 1) // 2
    dp = [[0] * (n + 1) for _ in range(n + 1)]
    dp[0][sum(a)] = 1

    for _ in range(k):
        new_dp = [[0] * (n + 1) for _ in range(n + 1)]
        for inversions in range(n + 1):
            for sorted_elements in range(n + 1):
                if dp[inversions][sorted_elements] == 0:
                    continue
                for i in range(n):
