def solve():
    mod = 998244353

    n = int(input())
    problems = [list(map(int, input().split())) for _ in range(n)]

    def inv(x):
        return pow(x, mod - 2, mod)

    fact = [1] * (n + 1)
    for i in range(1, n + 1):
        fact[i] = fact[i - 1] * i % mod

    inv_fact = [1] * (n + 1)
    inv_fact[n] = inv(fact[n])
    for i in range(n, 1, -1):
        inv_fact[i - 1] = inv_fact[i] * i % mod

    dp = [0] * (n + 1)
    dp[0] = 1

    for i in range(1, n + 1):
        for j in range(i):
            dp[i] = (dp[i] + dp[j] * fact[j] % mod * fact[n - j - 1] % mod) % mod

    def C(k, m):
        return fact[m] * inv_fact[k] % mod * inv_fact[m - k] % mod

    ans = 0

    for mask in range(1 << n):
        l = [0] * (n + 1)
        r = [0] * (n + 1)
        l[0] = 0
        r[0] = mod - 1

        for i in range(n):
            if mask & (1 << i):
                l[i + 1] = problems[i][0]
                r[i + 1] = problems[i][1]
            else:
                l[i + 1] = 0
                r[i + 1] = mod - 1

        for i in range(n):
            for j in range(i + 1, n + 1):
                if r[i] > l[j] and r[j] > l[i]:
                    break
            else:
                ans = (ans + dp[n] * C(bin(mask).count("1"), n) % mod) % mod

    return ans

solve()

