import math

def solve():
    MOD = 1000000007

    def factorize(n):
        factors = []
        for i in range(2, int(math.sqrt(n)) + 1):
            while n % i == 0:
                factors.append(i)
                n //= i
        if n > 1:
            factors.append(n)
        return factors

    def count_permutations(n):
        factors = factorize(n)
        cnt = 1
        for factor in set(factors):
            cnt *= factors.count(factor) + 1
            cnt %= MOD
        return cnt

    n = int(input())
    result = count_permutations(n)
    print(result)

solve()

