from collections import deque

def solve():
    n, m, k = map(int, input().split())
    special_vertices = list(map(int, input().split()))

    graph = {}
    for _ in range(m):
        u, v, w = map(int, input().split())
        if u not in graph:
            graph[u] = []
        if v not in graph:
            graph[v] = []
        graph[u].append((v, w))
        graph[v].append((u, w))

    def bfs(start):
        queue = deque([(start, 0)])
        visited = set([start])
        max_distance = 0

        while queue:
            node, dist = queue.popleft()
            max_distance = max(max_distance, dist)

            for neighbor, weight in graph[node]:
                if neighbor not in visited:
                    visited.add(neighbor)
                    queue.append((neighbor, max(dist, weight)))

        return max_distance

    result = []
    for special_vertex in special_vertices:
        farthest_distance = 0
        for other_special_vertex in special_vertices:
            if other_special_vertex != special_vertex:
                distance = bfs(other_special_vertex)
                farthest_distance = max(farthest_distance, distance)
        result.append(farthest_distance)

    print(' '.join(map(str, result)))

solve()

