def solve():
    import math

    n = int(input())
    points = [tuple(map(int, input().split())) for _ in range(n)]

    def gcd(a, b):
        if b == 0:
            return a
        return gcd(b, a % b)

    def on_same_line(p1, p2, p3):
        x1, y1 = p1
        x2, y2 = p2
        x3, y3 = p3
        dx1, dy1 = x2 - x1, y2 - y1
        dx2, dy2 = x3 - x2, y3 - y2
        return dx1 * dy2 == dx2 * dy1

    if n <= 4:
        return "YES"

    for i in range(n-2):
        for j in range(i+1, n-1):
            d = abs(points[j][0] - points[i][0]), abs(points[j][1] - points[i][1])
            g = gcd(d[0], d[1])
            direction = (d[0]//g, d[1]//g) if g != 0 else (0, 0)
            group1, group2 = set(), set()
            for k in range(n):
                if (points[k][0] - points[i][0]) % direction[0] == 0 and (points[k][1] - points[i][1]) % direction[1] == 0:
                    group1.add(k)
                else:
                    group2.add(k)
            valid = True
            for k in range(n):
                if k in group1:
                    for l in group1:
                        if l != k and l in group1 and not on_same_line(points[i], points[k], points[l]):
                            valid = False
                            break
            if valid:
                return "YES"
    return "NO"


