                dp[i][j] += dp[i - 1][j + 1]
            if j - 1 >= 0:
                dp[i][j] += dp[i - 1][j - 1]
            dp[i][j] %= MOD

    ans = 0
    for j in range((2 * k * t) + 1):
        win_diff = j - (2 * k * t) + a - b
        if 0 <= win_diff < len(dp[t]):
            ans += dp[t][j]
            ans %= MOD

    print(ans)

solve()

