    ans = 0
    for i in range(h, 0, -1):
        mid = (1 << i) // 2
        if n == mid:
            return ans
        if n > mid:
            n -= mid
            ans += mid
            n = mid - n + 1
        else:
            ans += n
            n = mid - n
    return ans

