def solve():
    n = int(input())
    a, b = map(int, input().split())
    heights = list(map(int, input().split()))

    dp = [[float('inf')] * 2 for _ in range(n + 1)]
    dp[0][0] = dp[0][1] = 0

    for i in range(1, n + 1):
        for j in range(2):
            for k in range(2):
                if j == 0 and k == 0:
                    continue
                color_diff = 1 if j != k else 0
                dp[i][j] = min(dp[i][j], dp[i-1][k] + color_diff * heights[i-1] * (a if j == 0 else b))

    ans = min(dp[n])
    print(ans if ans < float('inf') else -1)

solve()

